import React, { Component } from "react";
import { reduxForm, Field } from "redux-form";

import { FormTitle } from "../formTitle";
import { FormInput, FormButton } from "../formFields";
import TextLink from "../textLink";

class createAccountForm extends Component {
  render() {
    return (
      <form className="createAccountForm">
        <FormTitle className="createAccountForm__title" text="Login" />
        <Field
          className="createAccountForm__email"
          placeholder="Enter Email"
          name="email"
          type="email"
          title="Email"
          component={FormInput}
        />
        <Field
          className="createAccountForm__password"
          placeholder="Enter Password"
          name="password"
          type="password"
          title="Password"
          component={FormInput}
        />
        <Field
          className="createAccountForm__login"
          name="login"
          type="submit"
          title="Login"
          component={FormButton}
        />
        <div className='sign-up-form__text-links'>
            <TextLink to='/forgot' text='Forgot Password'/>
            <TextLink to='/createAccount' text='Not a member? Register here'/>
        </div>

      </form>
    );
  }
}

createAccountForm = reduxForm({
  form: "createAccount"
})(createAccountForm);

export default createAccountForm;
